import React from "react";
import { Alert } from "reactstrap";

const AlertMsg = ({ alertType, alertText }) => {
  return (
    <div className={`alert alert-${alertType}`} role="alert">
      {alertText}
    </div>
  );
};

export default AlertMsg;
